//  pp=apply(pol,mat*#);

pp=pol;

  nn=cross(bb-aa,bb-cc);
  nn=nn/abs(nn);
  rgb=ambient;
 
  forall(lights,(
      shade=-sin(nn*#_1);

  );

//draw(center(pp),(nn_1,nn_2)*1+center(pp),color->(1,1,1));
);

//  pp=apply(pol,mat*#);
